import React from 'react';
import logo from './logo.svg';
import './App.css';
import firebase from 'firebase';
import './index.js'

function App() {
  const firebaseConfig = {
    apiKey: "AIzaSyDKDg7Mq09xYePGrispdnUyVM9zKRHUDPM",
    authDomain: "lofty-ivy-242102.firebaseapp.com",
    databaseURL: "https://lofty-ivy-242102.firebaseio.com",
    projectId: "lofty-ivy-242102",
    storageBucket: "lofty-ivy-242102.appspot.com",
    messagingSenderId: "622324747867",
    appId: "1:622324747867:web:859020f7962da2f3bc397e",
    measurementId: "G-7R1SF5M75N"
  };

firebase.initializeApp(firebaseConfig);

const preObject = document.getElementById('people');

const dbRefObject = firebase.database().ref().child('people');

// Sync object changes
dbRefObject.on('value', snap => {preObject.innerText = JSON.stringify(snap.val(), null, 3)});
// dbRefObject.on('value', snap => console.log(snap.val()));


  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>

    </div>
  );
}

export default App;
